import {BrowserRouter, Route} from "react-router-dom";
import LandingPage from "./LandingPage"


function App() {
  return (
    <BrowserRouter>
      <Route path="/" exact component={LandingPage}/>
    </BrowserRouter>
  );
}

export default App;
